  true,\n\t\"url\": null,\n\t\"notes\": \"The Office of Advocacyu2019s Small Business
  Profiles for the States and Territories are an annual analysis of each stateu2019s
  small business activities. They provide information on small business employment,
  industry composition, small business borrowing, exporting, and survival rates, as
  well as business owner demographics. The profiles provide information for the 50
  states, the District of Columbia, the U.S. territories, and the United States. Detailed
  historical data may be found in the Small Business Economy.\",\n\t\"license_title\":
